import React, {useState} from "react";
import {useDispatch} from 'react-redux'
import {useNavigate} from 'react-router-dom'
import { createOrderRequest } from '../redux/slices/orderSlice'
// import {fetchUsersRequest} from '../redux/slices/userSlice'
// import {fetchVehicleRequest} from '../redux/slices/vehicleSlice'



const CreateOrders = () =>{
    const dispatch = useDispatch()
    const navigate = useNavigate()

    const [details,setDetails] = useState({user_id:'',pickup_address:'',delivery_address:''})
    const userId = localStorage.getItem('userId');



    const handleChange = (e)=>{
        setDetails({...details, [e.target.name]:e.target.value})
    }

    const handleSubmit = (e) =>{
        e.preventDefault()
        // const details = {user_id:selectedUser,vehicle_id:selectedVehicle}
        details.user_id=userId
        console.log("<<<<<<",details)

        const data ={details,navigate}
        dispatch(createOrderRequest(data))
    }
    // useEffect(()=>{
    //     dispatch(fetchUsersRequest())
    // },[dispatch])

// if(error)return <p>{error}</p>
    return(
        <div>
            <h2>Create driver</h2>
            <form onSubmit={handleSubmit}>
            <input
                name="user_id"
                type="hidden"
                value={userId}
                onChange={handleChange}
                />
                      <input
                name="pickup_address"
                placeholder="pickup_address"
                type="text"
                value={details.pickup_address}
                onChange={handleChange}
                />
                      <input
                name="delivery_address"
                placeholder="delivery_address"
                type="text"
                value={details.delivery_address}
                onChange={handleChange}
                />
                <button type="submit">Submit</button>
            </form>
        </div>
    )
}
export default CreateOrders
